import React from 'react'
import "./Topbar.css"
import AddIcon from '@mui/icons-material/Add';
import { NavLink } from 'react-router-dom';
function Topbar() {
    return (
        <div class="navbar">
            <div class="brand">
                <a className="navbar-brand">UNH Social</a>
            </div>
            <div className='right'>
                <NavLink to="/create/post"><AddIcon style={{ color: "#ffffff" }} /></NavLink>
                <button className='btn btn-primary'>Profile</button>

            </div>
        </div>
    )
}

export default Topbar
